eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   astrologicalGlossary: () => (/* binding */ astrologicalGlossary),\n/* harmony export */   getAllGlossaryTerms: () => (/* binding */ getAllGlossaryTerms),\n/* harmony export */   getGlossaryByCategory: () => (/* binding */ getGlossaryByCategory),\n/* harmony export */   getGlossaryTerm: () => (/* binding */ getGlossaryTerm)\n/* harmony export */ });\nconst astrologicalGlossary = {\n    pt: {\n        // Termos Bsicos\n        \"Ascendente\": {\n            term: \"Ascendente\",\n            explanation: \"O Ascendente \\xe9 o signo que estava surgindo no horizonte leste no momento do seu nascimento. Ele representa como voc\\xea se apresenta ao mundo, sua m\\xe1scara social, o primeiro passo na vida e como os outros te veem inicialmente. \\xc9 diferente do seu signo solar e influencia muito sua apar\\xeancia e personalidade exterior.\",\n            category: \"basic\"\n        },\n        \"Regente do Mapa\": {\n            term: \"Regente do Mapa\",\n            explanation: \"O Regente do Mapa (tamb\\xe9m chamado de Regente Ascendente) \\xe9 o planeta que governa o signo do seu Ascendente. Ele \\xe9 considerado o planeta mais importante do seu mapa, pois representa sua energia vital, motiva\\xe7\\xe3o principal e a forma como voc\\xea expressa sua identidade no mundo. Onde ele est\\xe1 posicionado mostra onde voc\\xea direciona sua energia e foco.\",\n            category: \"basic\"\n        },\n        \"Signo Solar\": {\n            term: \"Signo Solar\",\n            explanation: \"O Signo Solar \\xe9 determinado pela posi\\xe7\\xe3o do Sol no momento do seu nascimento. Representa sua ess\\xeancia, identidade central, ego e a pessoa que voc\\xea est\\xe1 se tornando. \\xc9 a sua energia fundamental e como voc\\xea brilha no mundo. \\xc9 o signo mais conhecido e representa cerca de 30% da sua personalidade.\",\n            category: \"basic\"\n        },\n        \"Signo Lunar\": {\n            term: \"Signo Lunar\",\n            explanation: \"O Signo Lunar \\xe9 determinado pela posi\\xe7\\xe3o da Lua no momento do seu nascimento. Representa suas emo\\xe7\\xf5es, necessidades internas, instintos, mem\\xf3rias e como voc\\xea reage emocionalmente. \\xc9 sua parte mais sens\\xedvel, intuitiva e relacionada ao conforto e seguran\\xe7a. Mostra como voc\\xea processa sentimentos e busca carinho.\",\n            category: \"basic\"\n        },\n        \"Casas Astrol\\xf3gicas\": {\n            term: \"Casas Astrol\\xf3gicas\",\n            explanation: \"As Casas Astrol\\xf3gicas s\\xe3o 12 divis\\xf5es do mapa astral que representam diferentes \\xe1reas da vida. Cada casa simboliza um cen\\xe1rio onde as energias dos planetas se manifestam. Por exemplo, a Casa 1 representa voc\\xea mesmo, a Casa 4 sua fam\\xedlia e lar, a Casa 7 relacionamentos, e a Casa 10 sua carreira. O planeta que est\\xe1 em cada casa mostra como voc\\xea vivencia aquela \\xe1rea da vida.\",\n            category: \"houses\"\n        },\n        \"Casa\": {\n            term: \"Casa\",\n            explanation: \"Uma Casa Astrol\\xf3gica \\xe9 uma das 12 divis\\xf5es do mapa astral que representa \\xe1reas espec\\xedficas da vida. Cada casa tem um tema: Casa 1 (identidade), Casa 2 (recursos), Casa 3 (comunica\\xe7\\xe3o), Casa 4 (lar), Casa 5 (criatividade), Casa 6 (trabalho), Casa 7 (relacionamentos), Casa 8 (transforma\\xe7\\xe3o), Casa 9 (sabedoria), Casa 10 (carreira), Casa 11 (amizades), Casa 12 (espiritualidade).\",\n            category: \"houses\"\n        },\n        \"Aspectos\": {\n            term: \"Aspectos\",\n            explanation: 'Aspectos s\\xe3o \\xe2ngulos formados entre planetas no mapa astral. Eles mostram como as diferentes energias planet\\xe1rias interagem e se relacionam. Aspectos harm\\xf4nicos (como tr\\xedgono e sextil) indicam facilidades e talentos naturais. Aspectos tensos (como quadratura e oposi\\xe7\\xe3o) indicam desafios que promovem crescimento. Os aspectos s\\xe3o como o \"roteiro\" que mostra como os planetas conversam entre si.',\n            category: \"aspects\"\n        },\n        \"Tr\\xedgono\": {\n            term: \"Tr\\xedgono\",\n            explanation: \"O Tr\\xedgono \\xe9 um aspecto harmonioso de 120 graus entre dois planetas. Representa talentos naturais, facilidades e fluidez. As energias dos planetas envolvidos trabalham juntas de forma natural e espont\\xe2nea. \\xc9 como ter um dom inato que n\\xe3o requer esfor\\xe7o consciente para se manifestar.\",\n            category: \"aspects\"\n        },\n        \"Sextil\": {\n            term: \"Sextil\",\n            explanation: \"O Sextil \\xe9 um aspecto harmonioso de 60 graus entre dois planetas. Representa oportunidades e coopera\\xe7\\xe3o. As energias se complementam e oferecem chances de crescimento quando trabalhadas intencionalmente. Diferente do tr\\xedgono, o sextil precisa ser desenvolvido com esfor\\xe7o consciente.\",\n            category: \"aspects\"\n        },\n        \"Quadratura\": {\n            term: \"Quadratura\",\n            explanation: 'A Quadratura \\xe9 um aspecto tenso de 90 graus entre dois planetas. Representa conflitos internos que exigem a\\xe7\\xe3o e resolu\\xe7\\xe3o. \\xc9 atrav\\xe9s das quadraturas que crescemos, desenvolvemos for\\xe7a e superamos obst\\xe1culos. S\\xe3o como \"exerc\\xedcios espirituais\" que nos fortalecem, mesmo sendo desafiadores.',\n            category: \"aspects\"\n        },\n        \"Oposi\\xe7\\xe3o\": {\n            term: \"Oposi\\xe7\\xe3o\",\n            explanation: \"A Oposi\\xe7\\xe3o \\xe9 um aspecto de 180 graus entre dois planetas, criando uma polaridade. For\\xe7as opostas pedem integra\\xe7\\xe3o e equil\\xedbrio. Frequentemente se manifesta em relacionamentos externos, onde encontramos pessoas que nos desafiam ou completam. \\xc9 uma energia que pede consci\\xeancia e negocia\\xe7\\xe3o entre extremos.\",\n            category: \"aspects\"\n        },\n        \"Conjun\\xe7\\xe3o\": {\n            term: \"Conjun\\xe7\\xe3o\",\n            explanation: 'A Conjun\\xe7\\xe3o ocorre quando dois planetas est\\xe3o pr\\xf3ximos, com 0 graus de separa\\xe7\\xe3o (com uma pequena toler\\xe2ncia chamada \"orbe\"). Representa a fus\\xe3o de energias, onde os planetas se unem e suas qualidades se misturam. Pode ser intensa e transformadora, criando uma energia combinada \\xfanica.',\n            category: \"aspects\"\n        },\n        \"Nodo Norte\": {\n            term: \"Nodo Norte\",\n            explanation: \"O Nodo Norte (ou Nodo Lunar Norte) representa o destino e prop\\xf3sito de vida que voc\\xea deve buscar nesta encarna\\xe7\\xe3o. \\xc9 seu caminho de evolu\\xe7\\xe3o, as qualidades que precisa desenvolver e as experi\\xeancias que precisa vivenciar para crescer. Mostra para onde voc\\xea deve direcionar seus esfor\\xe7os e onde encontrar satisfa\\xe7\\xe3o e realiza\\xe7\\xe3o.\",\n            category: \"points\"\n        },\n        \"Nodo Sul\": {\n            term: \"Nodo Sul\",\n            explanation: \"O Nodo Sul (ou Nodo Lunar Sul) representa talentos, padr\\xf5es e comportamentos que voc\\xea j\\xe1 desenvolveu em vidas passadas ou na inf\\xe2ncia. S\\xe3o facilidades e v\\xedcios que voc\\xea traz naturalmente, mas que podem te manter preso ao passado. Mostra de onde voc\\xea vem e o que precisa deixar para tr\\xe1s para evoluir.\",\n            category: \"points\"\n        },\n        \"MC\": {\n            term: \"MC (Meio do C\\xe9u)\",\n            explanation: \"O MC (Meio do C\\xe9u) \\xe9 o ponto mais alto do mapa astral, relacionado \\xe0 Casa 10. Representa sua voca\\xe7\\xe3o, carreira, reputa\\xe7\\xe3o p\\xfablica, objetivos de vida e como voc\\xea quer ser reconhecido no mundo. \\xc9 sua imagem profissional e o legado que voc\\xea quer deixar. O signo no MC mostra como voc\\xea se expressa publicamente.\",\n            category: \"points\"\n        },\n        \"IC\": {\n            term: \"IC (Fundo do C\\xe9u)\",\n            explanation: \"O IC (Fundo do C\\xe9u) \\xe9 o ponto mais baixo do mapa astral, relacionado \\xe0 Casa 4. Representa suas ra\\xedzes, fam\\xedlia, lar, vida privada e fundamentos emocionais. \\xc9 seu mundo \\xedntimo, seu ref\\xfagio e o que te d\\xe1 seguran\\xe7a. O signo no IC mostra como voc\\xea vivencia sua vida dom\\xe9stica e familiar.\",\n            category: \"points\"\n        },\n        \"Reg\\xeancia\": {\n            term: \"Reg\\xeancia\",\n            explanation: 'Reg\\xeancia \\xe9 a rela\\xe7\\xe3o entre um planeta e um signo, onde cada planeta \"governa\" ou tem afinidade especial com um ou dois signos. Por exemplo, Marte rege \\xc1ries e Escorpi\\xe3o, V\\xeanus rege Touro e Libra. Quando um planeta est\\xe1 no signo que rege, ele est\\xe1 em sua \"casa\" e expressa suas qualidades de forma mais natural e poderosa.',\n            category: \"advanced\"\n        },\n        \"Exalta\\xe7\\xe3o\": {\n            term: \"Exalta\\xe7\\xe3o\",\n            explanation: 'Exalta\\xe7\\xe3o \\xe9 uma posi\\xe7\\xe3o onde um planeta expressa suas melhores qualidades. \\xc9 como estar em \"primeira classe\" - o planeta funciona de forma excelente, embora de forma diferente de quando est\\xe1 no signo que rege. Por exemplo, o Sol est\\xe1 exaltado em \\xc1ries e a Lua em Touro.',\n            category: \"advanced\"\n        },\n        \"Qu\\xedron\": {\n            term: \"Qu\\xedron\",\n            explanation: 'Qu\\xedron \\xe9 um planeta menor (asteroide) conhecido como \"o ferido-curador\". Representa suas feridas profundas, traumas de inf\\xe2ncia e \\xe1reas onde voc\\xea se sente vulner\\xe1vel. Mas tamb\\xe9m mostra seu potencial de cura, compaix\\xe3o e capacidade de ajudar outros atrav\\xe9s de suas pr\\xf3prias experi\\xeancias dolorosas. \\xc9 onde voc\\xea encontra sua miss\\xe3o de cura.',\n            category: \"planets\"\n        },\n        \"Lilith\": {\n            term: \"Lilith\",\n            explanation: \"Lilith (tamb\\xe9m chamada de Lua Negra) representa sua natureza selvagem, instintiva e n\\xe3o-domada. \\xc9 a parte de voc\\xea que rejeita conven\\xe7\\xf5es sociais, que busca independ\\xeancia absoluta e que pode desafiar o que \\xe9 esperado. Mostra suas sombras, sua sexualidade aut\\xeantica e onde voc\\xea precisa se libertar de expectativas alheias.\",\n            category: \"points\"\n        },\n        \"Tr\\xedade Fundamental\": {\n            term: \"Tr\\xedade Fundamental\",\n            explanation: \"A Tr\\xedade Fundamental \\xe9 formada pelo Sol, Lua e Ascendente - os tr\\xeas pontos mais importantes do mapa astral. O Sol representa quem voc\\xea est\\xe1 se tornando (sua ess\\xeancia), a Lua representa quem voc\\xea \\xe9 interiormente (suas emo\\xe7\\xf5es) e o Ascendente representa como voc\\xea aparece no mundo (sua m\\xe1scara). Juntos, eles formam o n\\xfacleo da sua personalidade.\",\n            category: \"basic\"\n        }\n    },\n    en: {\n        // Basic Terms\n        \"Ascendente\": {\n            term: \"Ascendant\",\n            explanation: \"The Ascendant is the zodiac sign that was rising on the eastern horizon at the moment of your birth. It represents how you present yourself to the world, your social mask, your first step in life, and how others initially see you. It is different from your sun sign and greatly influences your appearance and outer personality.\",\n            category: \"basic\"\n        },\n        \"Regente do Mapa\": {\n            term: \"Chart Ruler\",\n            explanation: \"The Chart Ruler (also called Ascendant Ruler) is the planet that rules the sign of your Ascendant. It is considered the most important planet in your chart, as it represents your vital energy, main motivation, and how you express your identity in the world. Where it is positioned shows where you direct your energy and focus.\",\n            category: \"basic\"\n        },\n        \"Signo Solar\": {\n            term: \"Sun Sign\",\n            explanation: \"Your Sun Sign is determined by the position of the Sun at the moment of your birth. It represents your essence, core identity, ego, and the person you are becoming. It is your fundamental energy and how you shine in the world. It is the most well-known sign and represents about 30% of your personality.\",\n            category: \"basic\"\n        },\n        \"Signo Lunar\": {\n            term: \"Moon Sign\",\n            explanation: \"Your Moon Sign is determined by the position of the Moon at the moment of your birth. It represents your emotions, internal needs, instincts, memories, and how you react emotionally. It is your most sensitive, intuitive part, related to comfort and security. It shows how you process feelings and seek affection.\",\n            category: \"basic\"\n        },\n        \"Casas Astrol\\xf3gicas\": {\n            term: \"Astrological Houses\",\n            explanation: \"The Astrological Houses are 12 divisions of the birth chart that represent different areas of life. Each house symbolizes a setting where planetary energies manifest. For example, House 1 represents yourself, House 4 your family and home, House 7 relationships, and House 10 your career. The planet in each house shows how you experience that area of life.\",\n            category: \"houses\"\n        },\n        \"Casa\": {\n            term: \"House\",\n            explanation: \"An Astrological House is one of 12 divisions of the birth chart that represents specific life areas. Each house has a theme: House 1 (identity), House 2 (resources), House 3 (communication), House 4 (home), House 5 (creativity), House 6 (work), House 7 (relationships), House 8 (transformation), House 9 (wisdom), House 10 (career), House 11 (friendships), House 12 (spirituality).\",\n            category: \"houses\"\n        },\n        \"Aspectos\": {\n            term: \"Aspects\",\n            explanation: 'Aspects are angles formed between planets in the birth chart. They show how different planetary energies interact and relate. Harmonious aspects (like trine and sextile) indicate natural talents and ease. Tense aspects (like square and opposition) indicate challenges that promote growth. Aspects are like the \"script\" that shows how planets communicate with each other.',\n            category: \"aspects\"\n        },\n        \"Tr\\xedgono\": {\n            term: \"Trine\",\n            explanation: \"The Trine is a harmonious aspect of 120 degrees between two planets. It represents natural talents, ease, and flow. The energies of the involved planets work together naturally and spontaneously. It is like having an innate gift that does not require conscious effort to manifest.\",\n            category: \"aspects\"\n        },\n        \"Sextil\": {\n            term: \"Sextile\",\n            explanation: \"The Sextile is a harmonious aspect of 60 degrees between two planets. It represents opportunities and cooperation. The energies complement each other and offer growth chances when worked on intentionally. Unlike the trine, the sextile needs to be developed with conscious effort.\",\n            category: \"aspects\"\n        },\n        \"Quadratura\": {\n            term: \"Square\",\n            explanation: 'The Square is a tense aspect of 90 degrees between two planets. It represents internal conflicts that require action and resolution. It is through squares that we grow, develop strength, and overcome obstacles. They are like \"spiritual exercises\" that strengthen us, even though they are challenging.',\n            category: \"aspects\"\n        },\n        \"Oposi\\xe7\\xe3o\": {\n            term: \"Opposition\",\n            explanation: \"The Opposition is an aspect of 180 degrees between two planets, creating a polarity. Opposing forces ask for integration and balance. It often manifests in external relationships, where we meet people who challenge or complete us. It is an energy that asks for awareness and negotiation between extremes.\",\n            category: \"aspects\"\n        },\n        \"Conjun\\xe7\\xe3o\": {\n            term: \"Conjunction\",\n            explanation: 'The Conjunction occurs when two planets are close, with 0 degrees of separation (with a small tolerance called \"orb\"). It represents the fusion of energies, where planets unite and their qualities mix. It can be intense and transformative, creating a unique combined energy.',\n            category: \"aspects\"\n        },\n        \"Nodo Norte\": {\n            term: \"North Node\",\n            explanation: \"The North Node (or Lunar North Node) represents the destiny and life purpose you should seek in this incarnation. It is your path of evolution, the qualities you need to develop, and the experiences you need to have to grow. It shows where you should direct your efforts and where to find satisfaction and fulfillment.\",\n            category: \"points\"\n        },\n        \"Nodo Sul\": {\n            term: \"South Node\",\n            explanation: \"The South Node (or Lunar South Node) represents talents, patterns, and behaviors you have already developed in past lives or childhood. They are natural abilities and vices you bring, but which may keep you stuck in the past. It shows where you come from and what you need to leave behind to evolve.\",\n            category: \"points\"\n        },\n        \"MC\": {\n            term: \"MC (Midheaven)\",\n            explanation: \"The MC (Midheaven) is the highest point of the birth chart, related to House 10. It represents your vocation, career, public reputation, life goals, and how you want to be recognized in the world. It is your professional image and the legacy you want to leave. The sign on the MC shows how you express yourself publicly.\",\n            category: \"points\"\n        },\n        \"IC\": {\n            term: \"IC (Imum Coeli)\",\n            explanation: \"The IC (Imum Coeli) is the lowest point of the birth chart, related to House 4. It represents your roots, family, home, private life, and emotional foundations. It is your intimate world, your refuge, and what gives you security. The sign on the IC shows how you experience your domestic and family life.\",\n            category: \"points\"\n        },\n        \"Reg\\xeancia\": {\n            term: \"Rulership\",\n            explanation: 'Rulership is the relationship between a planet and a sign, where each planet \"governs\" or has a special affinity with one or two signs. For example, Mars rules Aries and Scorpio, Venus rules Taurus and Libra. When a planet is in the sign it rules, it is in its \"home\" and expresses its qualities in a more natural and powerful way.',\n            category: \"advanced\"\n        },\n        \"Exalta\\xe7\\xe3o\": {\n            term: \"Exaltation\",\n            explanation: 'Exaltation is a position where a planet expresses its best qualities. It is like being in \"first class\" - the planet functions excellently, though differently than when in the sign it rules. For example, the Sun is exalted in Aries and the Moon in Taurus.',\n            category: \"advanced\"\n        },\n        \"Qu\\xedron\": {\n            term: \"Chiron\",\n            explanation: 'Chiron is a minor planet (asteroid) known as \"the wounded-healer\". It represents your deep wounds, childhood traumas, and areas where you feel vulnerable. But it also shows your healing potential, compassion, and ability to help others through your own painful experiences. It is where you find your healing mission.',\n            category: \"planets\"\n        },\n        \"Lilith\": {\n            term: \"Lilith\",\n            explanation: \"Lilith (also called Black Moon) represents your wild, instinctive, and untamed nature. It is the part of you that rejects social conventions, seeks absolute independence, and may challenge what is expected. It shows your shadows, your authentic sexuality, and where you need to free yourself from others' expectations.\",\n            category: \"points\"\n        },\n        \"Tr\\xedade Fundamental\": {\n            term: \"Fundamental Triad\",\n            explanation: \"The Fundamental Triad is formed by the Sun, Moon, and Ascendant - the three most important points in the birth chart. The Sun represents who you are becoming (your essence), the Moon represents who you are internally (your emotions), and the Ascendant represents how you appear in the world (your mask). Together, they form the core of your personality.\",\n            category: \"basic\"\n        }\n    }\n};\n/**\n * Obtm a explicao de um termo tcnico\n */ function getGlossaryTerm(term, language = \"pt\") {\n    // Tentar encontrar o termo exato\n    const exactMatch = astrologicalGlossary[language][term];\n    if (exactMatch) {\n        return exactMatch;\n    }\n    // Tentar encontrar por variaes comuns\n    const variations = {\n        pt: {\n            \"Ascendente\": [\n                \"Asc\",\n                \"ASC\",\n                \"Ascendente\"\n            ],\n            \"Regente do Mapa\": [\n                \"Regente\",\n                \"Regente do Mapa\",\n                \"Regente Ascendente\"\n            ],\n            \"Signo Solar\": [\n                \"Sol\",\n                \"Signo Solar\",\n                \"Signo do Sol\"\n            ],\n            \"Signo Lunar\": [\n                \"Lua\",\n                \"Signo Lunar\",\n                \"Signo da Lua\"\n            ],\n            \"Casas Astrol\\xf3gicas\": [\n                \"Casas\",\n                \"Casas Astrol\\xf3gicas\"\n            ],\n            \"Tr\\xedade Fundamental\": [\n                \"Tr\\xedade\",\n                \"Tr\\xedade Fundamental\"\n            ]\n        },\n        en: {\n            \"Ascendente\": [\n                \"Ascendant\",\n                \"ASC\",\n                \"Rising Sign\"\n            ],\n            \"Regente do Mapa\": [\n                \"Chart Ruler\",\n                \"Ruler\",\n                \"Ascendant Ruler\"\n            ],\n            \"Signo Solar\": [\n                \"Sun\",\n                \"Sun Sign\"\n            ],\n            \"Signo Lunar\": [\n                \"Moon\",\n                \"Moon Sign\"\n            ],\n            \"Casas Astrol\\xf3gicas\": [\n                \"Houses\",\n                \"Astrological Houses\"\n            ],\n            \"Tr\\xedade Fundamental\": [\n                \"Triad\",\n                \"Fundamental Triad\"\n            ]\n        }\n    };\n    const langVariations = variations[language] || {};\n    for (const [key, values] of Object.entries(langVariations)){\n        if (values.includes(term)) {\n            return astrologicalGlossary[language][key] || null;\n        }\n    }\n    return null;\n}\n/**\n * Obtm todos os termos de uma categoria\n */ function getGlossaryByCategory(category, language = \"pt\") {\n    return Object.values(astrologicalGlossary[language]).filter((term)=>term.category === category);\n}\n/**\n * Obtm todos os termos do glossrio\n */ function getAllGlossaryTerms(language = \"pt\") {\n    return Object.values(astrologicalGlossary[language]);\n}\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./src/utils/astrologicalGlossary.ts\n");

